Rezept für 8 Portionen
1 Zwiebel
2 Knoblauchzehen 
1 Stück Ingwer 
2 Möhren 
250 g grüne Bohnen
2 EL Öl 
2 TL gelbe Currypaste
1 Dose Kokosmilch (400 g)
1 Dose Kichererbsen (400 g)
Salz, Pfeffer
▶️Zwiebel, Knoblauch und Ingwer schälen und fein würfeln. Möhren schälen und klein schneiden. Bohnen waschen putzen und in mundgerechte Stücke schneiden
▶️Öl in einem großen Topf erhitzen, Zwiebeln, Knoblauch, Ingwer und Möhren bei mittlerer Hitze kurz anbraten. Bohnen dazugeben und mit 40 ml Wasser ablöschen.
▶️Alles bei mittlerer Hitze zugedeckt 5-7 Minuten garen
▶️Currypaste, Kokosmilch und die abgetropften Kichererbsen unterrühren. Mit Salz und Pfeffer abschmecken und 10-15 Minuten köcheln lassen.
▶️Dazu passen Nudeln, Reis, Hirse oder Bulgur

