Days 1-2 🍃

The first wave of cleansing is usually the worst. Headaches, dizziness, nausea, bad breath, glazed eyes, and a heavily coated tongue are signs of the first stage of cleansing. Hunger can be the most intense in this period unless an enema is used, which quickly assists the body into the fasting state by ending digestion in the colon.

Days 3-7 🍃

The skin may become oily as rancid oils are purged from the body. People with problem-free skin may have a few days of pimples or even a boil. A pallid complexion is also a sign of waste in the blood. You may feel hungry for the first few days of the cleanse. This effect is temporary. The desire to eat will disappear. Lack of hunger may last 40 to 60 days, depending on whether you are on water or juice. The body embraces the cleanse and the digestive system is able to take a much-needed rest, focusing all of its’ energies on cleansing and healing. White blood cell and immune system activity increases. You may feel pain in your lungs. The cleansing organs and the lungs are in the process of being repaired. Within the intestine, the colon is being repaired and impacted feces on the intestinal wall start to loosen. Shortly after the detoxification period you will bounce back with renewed energy and vigor. This is a strong indication that you are much less toxic than when you began this journey. From that point on, the cleansing periods will shorten and you will feel longer periods of renewed energy and calm. Your eyes will clear and you skin will glow. I hope that as you end your juice cleanse you take the opportunity to really look hard at your diet and see if you can use this experience to enhance your life from the inside out.
